import styled from "styled-components";

export const StyledAboutSection = styled.section`
  min-height: 90vh;
  width: 100%;
`;

export const ImageContainer = styled.div`
  height: 13rem;
  width: 13rem;
`;

export const StyledImage = styled.img`
  height: 12rem;
  width: 12rem;
  border-radius: 50%;
`;
